import React, { useState } from 'react';
import { IonHeader, 
    IonToolbar, 
    IonButtons, 
    IonButton, 
    IonTitle, 
    IonIcon, 
    IonMenu, 
    IonContent, 
    IonItem, 
    IonList, 
    IonLabel} from '@ionic/react';
import '../css/Menu.css';
import '../css/Global.css';
import { arrowBackOutline, home } from 'ionicons/icons';


const Menu: React.FC = props => {

    return(
        <IonMenu side="end" contentId="menuContent" menuId="first" id="menu">
            <IonContent id="menuContent" class="menuContent">
                <IonList no-border class="menuList">
                    <IonItem class="menuItem" lines="none">
                        <IonIcon class="menuIcon" icon={home} slot="start"></IonIcon>
                        <IonLabel>Home</IonLabel>
                    </IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                </IonList>
            </IonContent>
        </IonMenu>
    );
}

export default Menu;
